import React from "react";
import vid from "./Video/Mountain.mp4";


const Video=()=>{
    return(
        <div>
            <video width="750" height="500" controls={true} src={require("./Video/Mountain.mp4")} >

            </video>

        </div>
    );
}
export  default Video;
